import React from 'react';
import { useParams } from 'react-router-dom';
import {useGetRepoCollabQuery} from './api';

export const RepoPage: React.FC = () => {
    const { owner, repo } = useParams<{ owner: string; repo: string }>();
    const { data, isLoading } = useGetRepoCollabQuery({ owner, repo });

  return (
    <div>
      <h2>Collaborators for {owner}/{repo}</h2>
      {isLoading && <p>Loading...</p>}
      {/* {data?.map((collaborator: any) => ( */}
        <div key={collaborator.id}>
          <img src={collaborator.avatar_url} alt={collaborator.login} width="50" height="50" />
          <p>{collaborator.login}</p>
        </div>
      }
    </div>
  );
};
